import topp from "../../asstes/images/iplslider4.jpg";

const TopPerformers =()=>{
    return (
        <div className="top-container">
        <h1 className="top-heading">Top Performs</h1>
        <button className="top-btn">seeMore</button>
        <div className="top-image">
            <img className="top-image1" src={topp} alt="simple Images"/>
            <img className="top-image2" src="" alt="simple Images"/>
            <img className="top-image3" src="" alt="simple Images"/>
        </div>
        </div>
    )
}
export default TopPerformers;
